  Col,
  UncontrolledTooltip
} from "reactstrap";
// core components
import Header from "components/Headers/Header.jsx";
import krazyball from "/src/assets/img/brand/football.png"

class Icons extends React.Component {
  state = {};
  render() {
    return (
      <>
        <Header />
        {/* Page content */}

        <Container className=" mt--7" fluid>
          {/* Table */}
          </Container>
      </>
    );
  }
}

export default Icons;
